import React, { useState } from 'react';
import OptionCard from './OptionCard';
import SearchResults from './SearchResults'; // 导入整合后的搜索结果组件
import './Service.css';

const options = {
  locations: [
    { text: 'Manhattan', image: 'https://assets.simpleviewinc.com/simpleview/image/upload/c_fill,h_391,q_75,w_588/v1/clients/newyorkstate/mariograzianophotography_Instagram_11d7bfa9-c11f-4feb-a919-13d479b99fd2.jpg' },
    { text: 'Brooklyn', image: 'https://images.ctfassets.net/1aemqu6a6t65/68nkexvLlGiTxvxFvzoELk/68ee51265baad76b8d7f5ae8cd99bf2c/brooklyn-bridge-sunset-julienne-schaer.jpg' },
    { text: 'Bronx', image: 'location2.jpg' },
    { text: 'Staten Island', image: 'location2.jpg' },
    { text: 'Queens', image: 'location2.jpg' },
    { text: 'Others', image: 'location2.jpg' },
  ],
  ageRanges: [
    { text: 'Under 10', image: 'age1.jpg' },
    { text: '11-21', image: 'age2.jpg' },
    { text: '22-54', image: 'age2.jpg' },
    { text: 'Over 55', image: 'age2.jpg' },
    { text: 'All Ages', image: 'age2.jpg' },
  ],
  serviceTypes: [
    { text: 'Education & Training', image: 'service1.jpg' },
    { text: 'Medical & Rehabilitation Services', image: 'service2.jpg' },
    { text: 'Social & Living Support', image: 'service2.jpg' },
    { text: 'Employment & Career Development', image: 'service2.jpg' },
    { text: 'Technology & Assistive Devices', image: 'service2.jpg' },
    // Add more service types
  ],
};

const Service = () => {
  const [selectedLocation, setSelectedLocation] = useState(null);
  const [selectedAgeRange, setSelectedAgeRange] = useState(null);
  const [selectedServiceTypes, setSelectedServiceTypes] = useState([]);

  const handleSelectServiceType = (serviceType) => {
    setSelectedServiceTypes((prev) =>
      prev.includes(serviceType)
        ? prev.filter((st) => st !== serviceType)
        : [...prev, serviceType]
    );
  };

  const handleSearch = () => {
    // 实现搜索逻辑，这里根据用户选择的条件过滤搜索结果
    const filteredResults = [
      {
        title: 'Schermerhorn Program',
        location: 'Bronx',
        ageRanges: ['Under 10', '11-21'],
        serviceTypes: ['Education & Training'],
        image: 'https://3.files.edl.io/d7d1/23/08/21/190246-d4a29c1d-6463-4e84-97a6-c979c98b4e08.jpg',
        description: 'The Schermerhorn Program has a 190-year history of serving students with blindness and visual impairments. It offers diverse educational services to meet the needs of children who are legally blind, from the ages of 5 to 21.',
        url: 'https://www.nyise.org/apps/pages/index.jsp?uREC_ID=409369&type=d&pREC_ID=892615',
        videoEmbed: null,
        mapEmbed: '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d897.1348090637564!2d-73.85885207208362!3d40.858929474871516!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x89c2f3592db30c29%3A0xb6bf1a26c6392f28!2sNew%20York%20Institute%20For%20Special%20Education!5e0!3m2!1sen!2sus!4v1719934279852!5m2!1sen!2sus" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>'
      },
      // 添加更多搜索结果对象
    ];

    // 根据选择的条件过滤结果
    const filtered = filteredResults.filter(result => {
      if (
        (!selectedLocation || result.location === selectedLocation) &&
        (!selectedAgeRange || result.ageRanges.includes(selectedAgeRange)) &&
        (selectedServiceTypes.length === 0 || selectedServiceTypes.every(type => result.serviceTypes.includes(type)))
      ) {
        return true;
      }
      return false;
    });

    return filtered;
  };

  return (
    <div className="search-page">
      <div className="options-section">
        <h2>Locations</h2>
        <div className="options-grid">
        {options.locations.map((option) => (
        <OptionCard
        key={option.text}
        option={option}
        onSelect={setSelectedLocation}
        isSelected={selectedLocation === option.text}
    />
  ))}
</div>
      </div>
      <div className="options-section">
        <h2>Age Range</h2>
        <div className="options-grid">
          {options.ageRanges.map((option) => (
          <OptionCard
          key={option.text}
          option={option}
          onSelect={setSelectedAgeRange}
          isSelected={selectedAgeRange === option.text}
        />
      ))}
</div>
      </div>
      <div className="options-section">
        <h2>Service Type</h2>
        <div className="options-grid">
          {options.serviceTypes.map((option) => (
            <OptionCard
              key={option.text}
              option={option}
              onSelect={handleSelectServiceType}
              isSelected={selectedServiceTypes.includes(option)}
            />
          ))}
        </div>
      </div>
      <button className="go-button" onClick={handleSearch}>
        <i className="fas fa-search"></i> GO
      </button>
      {/* Display search results */}
      <SearchResults results={handleSearch()} />
    </div>
  );
};

export default Service;
